import  React, {Component} from 'react';
import ReactDOM from 'react-dom';
import { Route, Link } from 'react-router-dom';
import {withRouter} from 'react-router-dom';
import { BrowserRouter } from 'react-router-dom';
import Projects from '../projects/projects';
import About from '../about/about';
import Contact from '../contact/contact';
import './home.css';

class Home extends Component {
    render() {
      return (
        <div className='Home'>
            <header className='homeHeader'>
              <div className="leafImage"> 
              </div>
            </header>
            <main>
              <p>
                My name is Rachel and I am a web developer with experience using Mongo/Node/Express/React to build full stack web apps. I currently have experience with full-stack web development, HTML, CSS, Javascript, JQuery, Bootstrap, AngularJS, ReactJS. I also have experience with UX/UI Design and technical writing. I am excited to deepend my knowledge in these areas and expand it to others. I am based in the Boston area, but am willing to work remotely or relocate. 
              </p>

            </main>
        </div>
      );
    } 
}

export default Home;
